import React, { Component } from "react";
import "./styles.css";

class Dots extends Component {
  state = {};
  render() {
    return (
      <span className="slider">
        <span className="dot"> </span>
        <span className="dot active"> </span>
        <span className="dot"> </span>
      </span>
    );
  }
}

export default Dots;
